import axios from "axios";
import './App.css';
import {useEffect, useState} from "react";

function App() {
    const [arr, setarr]=useState([]);
    useEffect(()=>{
        axios.get("https://api.music.msub.kr/?song=Life%20is%20Good").then(res=>{
            let data=res.data;
            setarr([
                ...arr,
                data["song"]
            ])
        })
    }, []);

  return (
      <div>
          {arr.map(s => {
              return s.map(v => {
                    return v[0]["name"];
              });
          })}
      </div>
  );
}

export default App;
